import React from 'react';
import { BrowserRouter as Router,Routes, Route } from 'react-router-dom';
import Employees from 'components/EmployeeContent';
import SalarySuggestion from 'components/SalarySuggestion';
import Header from 'components/Header';
import Sidebar from 'components/Sidebar';

function App() {
  return (
    <Router>
      <div className="App">
      <Header />
        <div className="container-fluid">
          <div className="row">
            <Sidebar />
            <div className="col-md-9">
              <Routes>
                <Route path="/employee" component={Employees} />
                <Route path="/salary-suggestion" component={SalarySuggestion} />
                {/* Add more routes for other views */}
              </Routes>
            </div>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
